import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  let items = props.expenses.map((item, index) => {
    return (
      <ExpenseItem
        key={index}
        title={item.title}
        amount={item.amount}
        date={item.date}
      ></ExpenseItem>
    );
  });

  return <div>{items}</div>;
}

export default Expenses;
